import "../styles/Home.scss";
import AOS from 'aos';
import 'aos/dist/aos.css';

const Hero = () => {
  AOS.init();

  return (<div className="hero">
    <svg height="20000" width="500">
  <path d="M 9 3 L 9 10 L 0 10 L 9 3" />
</svg>
    <div className="hero-grid">
        <div class="hero-grid-item" data-aos="fade-down" data-aos-duration="1000">
            <img src={require('../images/img1.jpeg')} alt="Benefit Model 1"/>
        </div>
        <div class="hero-grid-item" data-aos="fade-down" data-aos-duration="1000" data-aos-delay="900">
            <img src={require('../images/img2.jpeg')} alt="Benefit Model 1"/>
        </div>
        <div class="hero-grid-item" data-aos="fade-down" data-aos-duration="1000" data-aos-delay="400">
            <img src={require('../images/img3.jpeg')} alt="Benefit Model 1"/>
        </div>
    </div>
    <div className="hero-header">

    </div>
  </div>);
};

export default Hero;
